import styled from "styled-components/native"

export const FirstView1 = styled.View`
flex-direction: row;
align-items: center;

display: flex;
`;

export const BigText1 = styled.Text`
color: #CDA630;
font-size: 24px;
font-family:"Roboto";
`;

export const SecondView1 = styled.View`
display: flex;
margin-top: 231px;
align-items: center;
justify-content: center;

`
